import React, { useState, useEffect } from "react";

const Pistols = (props) => {
  const [pistolData, setPistolData] = useState([]);
  console.log(pistolData);
  useEffect(() => {
    setPistolData(props.fullData);
    console.log(pistolData);
  }, []);

  // useEffect(async () => {
  //   const info = await props.fullData;
  //   setPistolData(info);
  // }, []);

  return (
    <div className="pistol-Card">
      {pistolData
        ? pistolData.map((items) => <h2>{pistolData.documents}</h2>)
        : "loading"}
    </div>
  );
};

export default Pistols;
